sys_variable_value.value:
(function execute(inputs, outputs) {
    var data = new Array();
    var document;
    if (inputs.status_code == "200") {
        var response_json = JSON.parse(inputs.response);
        for (var i = 0; i < response_json.roles.length; i++) {
            document = new Object();
            document.label = response_json.roles[i].title; 
            document.name = response_json.roles[i].name;
            data.push(document);
        }
        var documents = new Object();
        documents.data =  data;
        outputs.documents = documents;
        outputs.status = "Success";
    } else {
        outputs.error_message = new GoogleIdentityAccessErrorHandler().documentErrorHandler(inputs, outputs);
    }
})(inputs, outputs);

